import React, { Component } from "react";

export class Post extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "",
    };
  }
  componentDidMount() {
    console.log("component did mount");
  }
  componentWillMount() {
    console.log("component will mount");
  }
  getName = () => {
    this.setState({
      name: "shruti",
    });
    console.log(name);
  };
  render() {
    return <div>{this.getName}</div>;
  }
}

export default Post;
